import React from "react";

const NavBar = () => {
  return (
    <div>
      <div>
        <ul >
          <li>Help</li>
          <li>Order & Returns</li>
          <li>Hi, Sanjay</li>
        </ul>
      </div>
    </div>
  );
};

export default NavBar;
